.free-consultant-btn{
    /* Auto layout */
    display: flex;
    flex-direction: row;
    align-items: flex-start;
    padding: 20px 40px;
    gap: 10px;

    position: absolute;

    background: linear-gradient(97.65deg, #56E0E0 0.33%, #007299 93.35%);
    /* w */

    box-shadow: 0px 10px 15px rgba(1, 115, 153, 0.2);
    border-radius: 39px;
}

.free-consultant-text{
    width: 174px;
    height: 24px;

    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    /* identical to box height */

    text-align: center;

    color: #FFFFFF;


    /* Inside auto layout */

    flex: none;
    order: 0;
    flex-grow: 0;
}

.banner-img-1{
    position:absolute;
    border-top-left-radius: 200px;
    border-bottom-left-radius: 15px;
}

